//A Filter is an object of keys that are the same as the data column names (category dates, ...), which map to arrays with accetable values
//Ex filter = {category: ['Sports', 'Music'], tags: ['birds'], dates:['11.11.2011']}
function filterData(filter, videos = allData){
  if(videos === undefined){
    return null;
  }
  var filteredVideos = {};
  const filterKeys = Object.keys(filter);
  const videoIDs = Object.keys(videos);
  for (let i =0; i< videoIDs.length; i++){
    let curVid =  videos[videoIDs[i]];
    let keep = true;
    for (let j =0; j<filterKeys.length; j++){
      let curKey = filterKeys[j]; //either category or tags
      let videoItems = curVid[curKey];
      let filterItems = filter[curKey];
      // console.log(filterItems, videoItems);
      let hasOne = false;
      if(videoItems != undefined){
        filterItems.forEach(function(filterItem){
          if(videoItems.includes(filterItem)){
            hasOne = true;
          }
        })
      }

      if (!hasOne){
        keep = false;
      }
    }
    if (keep){
      filteredVideos[videoIDs[i]]=curVid;
    }
  }
  return filteredVideos;
}

//Filter is similar to above, except it maps to a range ex {likes: [0, 2], Dates [0,1]}. Ranges are inclusive
function filterNumberData(filter, data = allData){
  if(data === undefined){
    return null;
  }
  var filteredData = {};
  const filterKeys = Object.keys(filter);
  const dataKeys = Object.keys(data);
  for (let i =0; i< dataKeys.length; i++){
    let curData =  data[dataKeys[i]];
    let keep = true;
    let dateKeys = Object.keys(curData['dates']);
    for (let k = 0; k<dateKeys.length; k++ ){
      let curDate = curData['dates'][dateKeys[k]];
      for (let j =0; j<filterKeys.length; j++){
        let curKey = filterKeys[j];
        if(curKey === 'dates'){
          keep = keepDate(dateKeys[k], filter[curKey]);
        }else{
          if (Number(filter[curKey][0]) > Number(curDate[curKey]) || Number(filter[curKey][1]) < Number(curDate[curKey])){
            keep = false;
            break;
          }
        }
      }
    }
    if (keep){
      filteredData[dataKeys[i]]=curData;
    }
  }
  return filteredData;
}
